import { setupJestCanvasMock } from 'jest-canvas-mock';
import { PixelCrop } from 'react-image-crop';

import {
  canvasPreview,
  base64ToBlob,
  blobToFile,
  fileToBase64,
  getBase64Image,
} from '../../../src/utils/images/imagesTransform';

describe('test in imagesTransform util', () => {
  let canvas, ctx: CanvasRenderingContext2D | null;
  beforeEach(() => {
    canvas = document.createElement('canvas');
    ctx = canvas.getContext('2d');
    jest.resetAllMocks();
    setupJestCanvasMock();
  });

  test('should show a canvas preview', () => {
    const canvas = document.createElement('canvas');
    const image = document.createElement('img');
    const crop: PixelCrop = {
      unit: 'px',
      x: 0,
      y: 0,
      width: 100,
      height: 100,
    };
    canvas.width = 400;
    canvas.height = 300;
    canvasPreview(image, canvas, crop);
    image.onload = () => {
      const canvasContext = canvas.getContext('2d');
      expect(canvasContext).not.toBeNull();
      const canvasData = canvasContext!.getImageData(
        0,
        0,
        canvas.width,
        canvas.height
      ).data;
      const isCanvasNotEmpty = canvasData.some((value) => value !== 0);
      expect(isCanvasNotEmpty).toBe(false);
    };
  });

  // test('should throw error if canvas param is null', () => {
  //   const image = document.createElement('img');
  //   const canvas = document.createElement('canvas');

  //   const crop: PixelCrop = {
  //     unit: 'px',
  //     x: 0,
  //     y: 0,
  //     width: 100,
  //     height: 100,
  //   };
  //   const scale = 1;
  //   const rotate = 0;
  //   const filter = 'none';

  //   expect(() => {
  //     canvasPreview(image, canvas, crop, scale, rotate, filter);
  //   }).toThrowError('No 2d context');
  // });

  test('should convert base64 to blob', () => {
    const base64String = `data:image/jpeg;base64,`;

    const blob = base64ToBlob(base64String);

    expect(blob instanceof Blob).toBe(true);

    expect(blob.type).toBe('image/jpeg');

    expect(blob.size).toBeGreaterThan(0);
  });

  test('should convert blob to file', () => {
    const data = new Uint8Array([1, 2, 3]);
    const mimeType = 'image/jpeg';
    const blob = new Blob([data], { type: mimeType });

    const fileName = 'ejemplo.jpg';

    const file = blobToFile(blob, fileName, mimeType);

    expect(file).toBeInstanceOf(File);
    expect(file.name).toBe(fileName);
    expect(file.type).toBe(mimeType);
  });

  test('should convert file to base64', async () => {
    const data = new Uint8Array([1, 2, 3]);
    const mimeType = 'image/jpeg';
    const blob = new Blob([data], { type: mimeType });
    const file = new File([blob], 'ejemplo.jpg', { type: mimeType });

    const base64String = await fileToBase64(file);

    expect(typeof base64String).toBe('string');
    expect(base64String.startsWith('data:image/jpeg;base64,')).toBe(true);

    const decodedData = atob(base64String.split(',')[1]);
    const decodedArray = new Uint8Array(decodedData.length);

    for (let i = 0; i < decodedData.length; ++i) {
      decodedArray[i] = decodedData.charCodeAt(i);
    }
    expect(decodedArray).toEqual(data);
  });

  test('should reject a promise if have read error', async () => {
    const emptyFile = new File([], 'vacio.txt', { type: 'text/plain' });

    try {
      await fileToBase64(emptyFile);
    } catch (error) {
      expect(error).toBeInstanceOf(Event);
    }
  });

  test('devuelve un valor de imagen base64 válido', () => {
    const canvas = document.createElement('canvas');
    const image = document.createElement('img');
    const crop: PixelCrop = {
      unit: 'px',
      x: 0,
      y: 0,
      width: 100,
      height: 100,
    };
    canvas.width = 400;
    canvas.height = 300;
    const base64Image = getBase64Image(image, canvas, crop);
    image.onload = () => {
      expect(base64Image).toMatch(/^data:image\/jpeg;base64,/);
    };
  });
});
